import styled from 'styled-components';

export const StyledButtonContainer = styled.div`
    margin-top:12%;
    margin-left: 24%;
    display:flex;
    flex-direction: column;
    justify-items: center;
    width: 50%;
`;

export const StyledTitleContainer = styled.h2`
    margin-bottom:8%;
`
